import { Stack, Typography } from "@mui/material";
import { color } from "@mui/system";
import React from "react";

const Footer = () => {
  return (
    <div
      className="footer"
      style={{
        padding: "20px",
        color: "#444",
      }}
    >
      <Stack alignItems="center" flex={1}>
        <Typography fontWeight="600">
          ห้างหุ้นส่วนจำกัด น้ำดื่มเพิ่มพูนทรัพย์ (สำนักงานใหญ่)
        </Typography>
        <Typography>Tel: 081-842-2554 , 081-985-3410</Typography>
        <Typography>Email: ppswater@yahoo.com</Typography>
      </Stack>

      <Typography
        sx={{
          display: "flex",
          justifyContent: "center",
          color: "#fff",
          position: "fixed",
          left: "0",
          bottom: "0",
          width: "100%",
          marginBottom: "2px",
        }}
      >
        © Copyright PPS water
      </Typography>
    </div>
  );
};

export default Footer;
